import navbarCSS from './styles/navbar.module.css';

function Navbar( {search, setSearch} ){

    return (
    <div>
        <nav>
            <ul>
                <li><a href='#'>home</a></li>
                <li><a href='#'>books</a></li>
                <li><a href='#'>groups</a></li>
                <li>
                    <div>
                        <input 
                            type="text" 
                            placeholder='search'
                            value={search}
                            onChange={(e) => setSearch(e.target.value)}
                            />
                        <div>
                            <img />
                            <p display='hidden'>{}</p>
                        </div>
                    </div>
                </li>
                <li><a href='#'>profile</a></li>
            </ul>
        </nav>
    </div>
    );
}

export default Navbar;
